import React from 'react';
import { Link } from 'react-router-dom';
import SignupSignInPopup from './SignupSignInPopup';
import backgroundImg from '../path/to/background-image.jpg'; // Adjust the path
import '../App.css';

const OnboardingPage = () => {
  return (
    <div className="onboarding-page" style={{ backgroundImage: `url(${backgroundImg})` }}>
      <header>
        <h1>Your Company Name</h1>
        {/* Add any other header content here */}
      </header>
      <section className="home-page">
        <h2>Welcome to Rentora</h2>
        {/* Add other content */}
      </section>
      <section className="about-page">
        {/* About page content */}
      </section>
      <Link to="#" className="get-started-btn">
        Get Started
      </Link>
      <SignupSignInPopup />
    </div>
  );
};

export default OnboardingPage;
